INSERT INTO `album` (`albumID`, `genreID`, `singerID`, `thumbnail`, `numberOfSongs`, `albumDescription`, `price`) VALUES
	('ALB001', 'GEN001', 'SNG001', _binary , 14, 'Chromatica is the sixth studio album by American singer Lady Gaga. It was released on May 29, 2020, by Streamline and Interscope Records. Chromatica is a dance-pop, synth-pop, and electropop album, incorporating genres like house, disco, and techno. The album features guest appearances from Ariana Grande, Elton John, and Blackpink.', 12.99),
	('ALB002', 'GEN001', 'SNG002', _binary , 16, ' is the third studio album by English singer-songwriter Ed Sheeran. It was released on 3 March 2017 through Asylum Records and Atlantic Records. The album contains a diverse range of music, including the genres pop, folk, hip hop, soul, and Irish folk. The album features the hit singles "Shape of You", "Castle on the Hill", and "Galway Girl".', 11.99),
	('ALB003', 'GEN002', 'SNG002', _binary , 12, 'No.6 Collaborations Project is the fourth studio album by English singer-songwriter Ed Sheeran. It was released on 12 July 2019 by Asylum Records and Atlantic Records. The album features collaborations with a variety of artists, including Justin Bieber, Bruno Mars, and Cardi B.', 9.99),
	('ALB004', 'GEN003', 'SNG001', _binary , 10, 'The Fame is the debut studio album by Lady Gaga, released on August 19, 2008 by Interscope Records. The album is primarily a dance-pop and electropop album, with influences of disco, glam rock, and synth-pop music. It features the hit singles "Just Dance", "Poker Face", and "Paparazzi".', 8.99),
	('ALB005', 'GEN004', 'SNG002', _binary , 13, 'x (pronounced "multiply") is the second studio album by English singer-songwriter Ed Sheeran. It was released on 20 June 2014 by Asylum Records and Atlantic Records. The album features the hit singles "Sing", "Dont AND Thinking Out Loud', 10.99),
	('ALB006', 'GEN005', 'SNG001', _binary , 11, 'Cheek to Cheek is a collaborative album by American singers Tony Bennett and Lady Gaga. It was released on September 19, 2014, by Streamline and Columbia Records. The album consists of jazz standards, with the help of a live band and a big band. It features songs such as "Anything Goes" and "I Cant Give You Anything But Love".', 11.99);

